import EmailContent from "../EmailContent/EmailContent";
import MediaContent from "../MediaContent/MediaContent";

const MainContent = () => {
  return (
    <div className="main-container">
      <div>
        <EmailContent />
      </div>
      <div className="main-content">
        <MediaContent />
      </div>
    </div>
  );
};
export default MainContent;
